webpackJsonp([67937189986593],{8420:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Homework",date:"17 Feb 2005",slug:"/2005-02-17-homework/",tags:"Y2005"},html:'<p><a href="http://www.flickr.com/photos/papascott/4962974/" title="Homework at Flickr"><img src="http://photos5.flickr.com/4962974_069dcc42c5_m.jpg" width="240" height="180" alt="Homework" border="0" /></a></p>\n<p>Christopher is busy tracing letters in his Laura\'s Star alphabet book.</p>\n<p>Right now Christopher totally enthralled by the <a href="http://www.amazon.de/exec/obidos/ASIN/3831500053">Lauras Stern</a> series of books (available in English as <a href="http://www.amazon.com/exec/obidos/ASIN/188844424X">Laura\'s Star</a>), in which Laura finds and mends a fallen star. He now dreams of flying in a cardboard rocket, just like Laura.</p>'},next:{fields:{title:"Where's The Towel?",date:"16 Feb 2005",slug:"/2005-02-16-wheres-the-towel/"}},previous:{fields:{title:"Dusting The Bookends",date:"19 Feb 2005",slug:"/2005-02-19-dusting-the-bookends/"}}},{node:{fields:{title:"Where's The Towel?",date:"16 Feb 2005",slug:"/2005-02-16-wheres-the-towel/",tags:"Y2005"},html:'<p><a title="Instapundit.com" href="http://instapundit.com/archives/021213.php">Instapundit</a>   points to the <a href="http://www.amazon.com/exec/obidos/redirect?tag=wwwviolentkicom&amp;path=subst/home/home.html/ref%3Dtab%5Ffr%5Fgw%5F1/">Hitchhiker\'s Guide to the Galaxy trailer</a> at <a href="http://amazon.com">amazon.com</a>. I\'m not into science fiction anymore, but Hitchhiker\'s Guide is, of course, philosophy. The trailer is a bit loud for philosophy, though, and I didn\'t notice a <a href="http://www.bbc.co.uk/cult/hitchhikers/guide/towel.shtml">towel</a>.</p>'},next:{fields:{title:"Keep Me Dumb, Please",date:"16 Feb 2005",slug:"/2005-02-16-keep-me-dumb-please/"}},previous:{fields:{title:"Homework",date:"17 Feb 2005",slug:"/2005-02-17-homework/"}}},{node:{fields:{title:"Keep Me Dumb, Please",date:"16 Feb 2005",slug:"/2005-02-16-keep-me-dumb-please/",tags:"Y2005"},html:'<p>Duncan rambles on  how we bloggers (among others) <a title="My Expatriate Odyssey: Just me< rambling on about media bias..." href="http://expat-odyssey.blogspot.com/2005/02/just-me-rambling-on-about-media-bias.html">keep ourselves dumb</a>.</p>\n<p>> We <span style="font-style: italic;">choose</span> to believe the hype, the conspiracy theories, and the <span style="font-style: italic;">outright lies</span><br />\nthat are fed to us by the media on a daily basis, and we bloggers seem<br />\nquite willing to embellish which ever brand of bias we prescribe too... ItÂ’s too much fun to <span style="font-style: italic;">bash</span> George Bush, and it remains to be too much of a blog traffic <span style="font-style: italic;">magnet</span> to just give up. The same holds true with bashing Hillary. It is, therefore, no surprise that <span style="font-style: italic;">dis</span>information is the literature of choice in the 21st century, as it was in the 20th, and the 19th.</p>'},next:{fields:{title:"C64, Where Are You?",date:"16 Feb 2005",slug:"/2005-02-16-c64-where-are-you/"}},previous:{fields:{title:"Where's The Towel?",date:"16 Feb 2005",slug:"/2005-02-16-wheres-the-towel/"}}}],pathPrefix:"",first:!1,last:!1,index:342,pageCount:1101}}}});
